import { Button, CardContent, Typography } from "@mui/material";
import Card from "@mui/material/Card";

const Dashboard = () => {
  return (
    <div>
      <Card sx={{ width: "25rem",backgroundColor:"rgba(0, 0, 0, 0.25)" }}>
        <CardContent
          sx={{
            display: "flex",
            justifyContent: "center",
            flexDirection: "column",
          }}
        >
          <Typography sx={{fontSize:"30px",fontWeight:"400", lineHeight:"34.47px"}}>Wallet Balance: <span style={{color:"rgba(157, 255, 91, 1)"}}>&#x20B9; 4500</span></Typography>
          <Button
            sx={{
              width: "80%",
              color: "#fff",
              backgroundColor: "rgba(181, 220, 82, 1)",
              borderRadius: "15px",
            }}
          >
            + Add Income
          </Button>
        </CardContent>
      </Card>
    </div>
  );
};

export default Dashboard;
